-- Table structure for table `jalur`
DROP TABLE IF EXISTS `jalur`;

CREATE TABLE `jalur` (
  `id_jalur` int NOT NULL AUTO_INCREMENT,
  `mode` enum('both','pejalan') COLLATE utf8mb4_general_ci DEFAULT 'both',
  `arah` enum('oneway','twoway') COLLATE utf8mb4_general_ci DEFAULT 'twoway',
  `panjang` decimal(10,3) DEFAULT NULL,
  `waktu_kaki` decimal(10,3) DEFAULT NULL,
  `waktu_kendara` decimal(10,3) DEFAULT NULL,
  `geometri` text COLLATE utf8mb4_general_ci,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id_jalur`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

